import React from 'react';
import './App.css';
import sample from './Lightning.mp4'

class App extends React.Component
{
  constructor(props)
  {
    super(props)
    this.state = {
      weather: sample,
      city: '',
      country: ''
    }

  }
  render()
  {
    return (
      <div class="container">

      <video id="video" autoPlay="true" loop="true">

          <source src={this.state.weather} type="video/mp4" />

      </video>

      <div class="overlay">

          <form>
              <div className="aboveSubmit">
              <span>Enter city name</span>
              <input type="text" value={this.state.city}></input>
              <span>Enter country name</span>
              <input type="text" value={this.state.country}></input>
              <button type="submit">Submit</button>
              </div>
          </form>

      </div>

  </div>


    )
  }
}

export default App;
